import {Link} from "react-router-dom"
import { IconButton } from "@chakra-ui/react"

import {  ImBlog} from "react-icons/im";

const Navbar = () => {
    return (  
        <nav className="navbar">
            <h1>

            </h1>
            <div className="links">
            <Link to="/">Home</Link>
            <Link to="/create" >New Post</Link>
            </div>
        </nav>
    );
}

export default Navbar;
